import React from 'react'
import "./Sectiontwo.css";

function Sectiontwo() {
  return (
    <div className='container-fluid' id='galleryone'>
        <h2 style={{ color: "#036", fontWeight: "500", paddingTop: "3rem"}}>Top Destinations</h2>
        <div className='row container-fluid text-center' style={{width: "85%"}}>
            <div className='col-3'><img src='https://www.keralatourism.org/images/homecontentimage/desktop/Alappuzha.jpg' alt='' /></div>
            <div className='col-3'><img src='https://www.keralatourism.org/images/homecontentimage/desktop/Alappuzha.jpg' alt='' /></div>
            <div className='col-3'><img src='https://www.keralatourism.org/images/homecontentimage/desktop/Alappuzha.jpg' alt='' /></div>
            <div className='col-3'><img src='https://www.keralatourism.org/images/homecontentimage/desktop/Alappuzha.jpg' alt='' /></div>
        </div>
    </div>
  )
}

export default Sectiontwo
